/* src/components/Main.tsx */
import React from "react";
import '../assets/styles/Main.scss';

function Main() {
  return (
    <div className="hero-section">
      <div className="hero-content-container">
        <div className="hero-text-content">
          <p className="greeting-text">Technical Briefing</p>
          <h1 className="hero-name">Shailee Patel</h1>
          <div className="hero-tags">
            <span className="tag">Software Engineer</span>
            <span className="tag">Traveler</span>
            <span className="tag">Photographer</span>
          </div>
          <p className="hero-subtitle">
            Specializing in architecting scalable, data-driven systems where technical precision meets creative purpose. 
            Much like an F1 strategist, I thrive on uncovering the stories hidden within data to drive smarter, more impactful decisions.
          </p>
          <div className="hero-cta-group">
            <button className="cta-button-primary">View Launch Log</button>
            <button className="cta-button-secondary">The Pit Wall</button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Main;
